import Upper from '../assets/sport/cat/up.jpg';
import Lowwer from '../assets/sport/cat/low.jpg';
import Bob from '../assets/sport/cat/body.jpg';
import Str from '../assets/sport/cat/stern.jpg';



export let MenuList = [
    {   
        name: "Yoga",
        image: Yo,
        price: 99.99 ,
        value : <button>Book now</button>,
    },
    {
        name: "Aerobic",
        image: Aerob,
        price: 89.99 ,
        value : <button>Book now</button>,
    },
    {
        name: "Upper-Body",
        image: Upper,
        price: 111.99 ,
        value : <button>Book now</button>,
    },
    {
        name: "Lower-Body",
        image: Lowwer,
        price: 110.99 ,
    },
    {
        name: "Body-bulder",
        image: Bob,
        price: 210.99,
    },
    {
        name: "strength",
        image: Str,
        price: 110.99,
    }
];
